const generateUniqueId = require('generate-unique-id');


const ContactList = ({ contactsList }) => {
    console.log(contactsList)

    return (
        <ul>
            {contactsList.map(item => (
                <li key={generateUniqueId()}>{item.name}: {item.number}</li>
            ))}
        </ul>
    )



}
export default ContactList;
